import { Navbar, Nav } from 'react-bootstrap';
import MyStyle from '../../styles/colorStyle';
const AdminNavbar = () => (
    <Navbar collapseOnSelect expand="lg" style={MyStyle.nav_background} variant="dark">
        <Navbar.Brand href="#home" style={{flex: '1'}}>Muhalik</Navbar.Brand>
        <Navbar.Brand href="#home" style={{flex: '2'}}>Admin Dashboard</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="mr-auto">
            </Nav>
            <Nav>
                <Nav.Link href=""> Signout </Nav.Link>
            </Nav>
        </Navbar.Collapse>
    </Navbar>
);

export default AdminNavbar;

